日志组件调用
在组件库开发中，可能需要不同级别的日志记录，系统支持8种标准的日志级别策略，分别为：fatal,error,warn,info,debug,trace,audit,metric，可根据开发需要，制定规则，输出不同级别的日志。
常见日志策略：
ERROR | 错误：指明错误事件，但应用可能还能继续运行。 
WARN | 警告：指明可能潜在的危险状况。 
INFO | 信息：指明描述信息，从粗粒度上描述了应用运行过程。
DEBUG | 调试：指明细致的事件信息，对调试应用最有用。 
