cflags! / cflags_cc! / defines 三行指定如果 c 程序碰到意外错误的时候，由 NAPI 接口来处理，而不是通常的由 c 程序自己处理。这防止因为 c 部分程序碰到意外直接就退出了程序，而是由 nodejs
